            //Here you can put other code that not related to dapi logic
        }

        function onReadyCallback(){
            //No need to listen to this event anymore
            dapi.removeEventListener("ready", onReadyCallback);

            //If the ad is visible start the game
            dapi.isViewable() ? startGame(): null;

            let isAudioEnabled = !!dapi.getAudioVolume();
            dapi.addEventListener("audioVolumeChange", audioVolumeChangeCallback);

            //Use dapi functions
            dapi.addEventListener("viewableChange", viewableChangeCallback);
            dapi.addEventListener("adResized", orientationCallback);
        }

        function startGame() {
            //start your game
            var screenSize = dapi.getScreenSize();
        }

        function viewableChangeCallback(e){
            e.isViewable ? this.startGame() : pause(); //start the game or resume
        }

            let isAudioEnabled = !!volume;
            if (isAudioEnabled){
                //START or turn on the sound
            } else {
                //PAUSE the turn off the sound
            }
        }

        }

var isClick = new Boolean(false);

function loadVideo(vid,vidSource,videoName){
    resetCSS(vid);
    vidSource.setAttribute('src', videoName);
    vid.load();
}

function loadBgVideo(vid,vidSource,videoName){
    vidSource.setAttribute('src', videoName);
    vid.load();
}

function pauseVideo(vid) {
    vid.pause();   
}

function playVideo(vid) {
    var promise = vid.play();
    if (promise !== undefined) {
        promise.then(_ => {
            
        }).catch(error => {
            vid.muted = true;
            vid.play();
        });
    }
}

function resetCSS(vid){
    vid.style.paddingTop        = 0;
    vid.style.paddingBottom     = 0;
    vid.style.height = "100%";
    vid.style.maxWidth = "100%";
    vid.style.textAlign = "center";
}

function clickthrough(event){
    if(isClick == true)
    {
        return;
    }

    isClick = true;
    var startVid  = document.getElementById('start_video');
    var finishVid = document.getElementById('finish_video');
    var startBgVid = document.getElementById('start_video_bg');
    var finishBgVid = document.getElementById('finish_video_bg');

    startVid.muted = false;
    
    finishVid.classList.remove('hidden');
    startVid.classList.add('hidden');
    finishBgVid.classList.remove('hidden');
    startBgVid.classList.add('hidden');


    playVideo(finishVid);
    playVideo(finishBgVid);

    delayedCall(2.3, userClickedDownloadButton);
}

// 数秒後に実行メソッド
function delayedCall(second, callBack){
  setTimeout(callBack, second * 1000);
}

function startVideo()
{
    var startVid = document.getElementById('start_video');
    var start_vidsource = document.getElementById('start_vidsource');
    loadVideo(startVid,start_vidsource,start_mp4);
    playVideo(startVid);

    var startBgVid = document.getElementById('start_video_bg');
    var startBgVidSource = document.getElementById('start_vidsource_bg');
    loadBgVideo(startBgVid,startBgVidSource,start_mp4);
    playVideo(startBgVid);

    var finishVid = document.getElementById('finish_video');
    var finish_vidsource = document.getElementById('finish_vidsource');
    loadVideo(finishVid,finish_vidsource,finish_mp4);
    pauseVideo(finishVid);

    var finishBgVid = document.getElementById('finish_video_bg');
    var finishBgVidSource = document.getElementById('finish_vidsource_bg');
    loadBgVideo(finishBgVid,finishBgVidSource,finish_mp4);
    pauseVideo(finishBgVid);
}
</script>

<style>
html, body {
    height:100%;
    padding: 0;
    margin: 0;
} 
body {
    background-color: black; /* black bars */
    background-size: 100%; /* portrait - height fixed, width variable - lock variable to 133% max */ 
    background-repeat: no-repeat;
    background-position: center center;
    text-align:center;
    overflow: hidden; /* no scrollbar */
}
video{
    padding: 0;
    margin: 0;
    object-fit: cover;
    z-index: 111;
}
video#start_video_bg, video#finish_video_bg{
    position: absolute;
    width: calc(100% + 36px);
    left: 0;
    top: 0;
    height: calc(100% + 36px);
    z-index: -1000;
    -ms-filter: blur(18px);
    filter: blur(18px);
    margin: -22px;
}
video.hidden {
  display: none;
}

</style>

<body ontouchstart="clickthrough(event)" onmousedown="clickthrough(event)">
<video id="start_video_bg" preload="auto" playsinline autoplay loop muted>
    <source id = "start_vidsource_bg" src="" type="video/mp4">
</video>
<video id = "start_video" preload="auto" playsinline autoplay loop>
    <source id = "start_vidsource" src="" type="video/mp4">
</video>
<video id="finish_video_bg" preload="auto" playsinline autoplay loop muted class="hidden">
    <source id = "finish_vidsource_bg" src="" type="video/mp4">
</video>
<video id = "finish_video" preload="auto" playsinline autoplay muted class="hidden">
    <source id = "finish_vidsource" src="" type="video/mp4">
</video>
</body>
</html>
